import React from 'react';
import s from './Dialogs.module.css';
import {NavLink} from "react-router-dom";

type DialogItemPropsType = {
    name: string
    id: string
}

const DialogItem = (props: DialogItemPropsType) => {
    let path = '/dialogs/' + props.id;

    return (
        <div className={s.dialogItem + ' ' + s.active}>
            <NavLink to={path}>
                {props.name}
            </NavLink>
        </div>
    )
}
const Dialogs = () => {
    return (
        <div className={s.dialogs}>
            <div className={s.dialogsItems}>
                <DialogItem name={'Dimych'} id={'1'}/>
                <div className={s.dialogItem}><NavLink to='/dialogs/2'>Andrey</NavLink></div>
                <div className={s.dialogItem}><NavLink to='/dialogs/3'>Sveta</NavLink></div>
                <div className={s.dialogItem}><NavLink to='/dialogs/4'>Viktor</NavLink></div>
                <div className={s.dialogItem}><NavLink to='/dialogs/5'>Valera</NavLink></div>
                <div className={s.dialogItem}><NavLink to='/dialogs/6'>Sasha</NavLink></div>
            </div>
            <div className={s.messages}>
                <div className={s.message}>Hi</div>
                <div className={s.message}>How is your day?</div>
                <div className={s.message}>Yo</div>
            </div>
        </div>
    );
};

export default Dialogs;
